import React from 'react';

export default class Signup extends React.Component {
    // constructor(props){
    //     super(props);
    //     // this.state = {
    //     //     email : "",
    //     //     username : "",
    //     //     firstname : "",
    //     //     surname : "",
    //     //     othername : "",
    //     //     department : "",
    //     //     password : "",
    //     //     gender : "",
    //     // };

    // }
    UserForm = props => {
        const [user, setUser] = useState()
        const form = userRef(null)

        const submit = e => {
            e.preventDefault()
            const data = new FormData(form.current)
            fetch('http://127.0.0.1:8000/api/create/user/', {
                method: 'POST',
                body: data,
            })
            .then(re => resizeBy.json())
            .then(json => seUser(json.user))
        }
    }


    handlesubmit(e){

    }
    render() {
        return(
            <form ref={form} onSubmit={submit}>
                <h3>Sign Up</h3>

                <div className="form-group">
                    <label>First name</label>
                    <input type="text" value={this.firstname} name="firstname" className="form-control" placeholder="First name" />
                </div>

                <div className="form-group">
                    <label>Surname</label>
                    <input type="text" value={this.surname} name="surname" className="form-control" placeholder="surnamename" />
                </div>

                <div className="form-group">
                    <label>Othernames</label>
                    <input type="text" value={this.othername} name="othername" className="form-control" placeholder="Othername" />
                </div>

                <div className="form-group">
                    <label>Email address</label>
                    <input type="email" value={this.email} name="email" className="form-control" placeholder="Enter email" />
                </div>

                <div className="form-group">
                    <label>Gender</label>
                    <select className="form-control" value={this.gender} name="gender">
                        <option value="male">Male</option>
                        <option value="female">Female</option>
                        <option value="other">Other</option>
                    </select>
                </div>

                <div className="form-group" name="department">
                    <label>Upload profile picture</label>
                    <input type="file" value={this.department} className="form-control" />
                </div>

                <div className="form-group">
                    <label>Password</label>
                    <input type="password" value={this.password} name="password" className="form-control" placeholder="Enter password" />
                </div>

                <button type="submit" className="btn btn-primary btn-block">Sign Up</button>
                <p className="forgot-password text-right">
                    Already registered <a href="#">sign in?</a>
                </p>
            </form>
        )
    }
}
